import React from "react";

export default function Element({
  elementName,
  elementSymbol,
  elementNumber,
  elementMass,
}) {
  return (
    <>
      <div className="element">
        <div className="element__number">{elementNumber}</div>
        <div className="element__symbol">S</div>
        <div className="element__name">{elementName}</div>
        <div className="element__mass">A</div>
      </div>
    </>
  );
}
